import React, { Component } from 'react';
import { gql } from 'apollo-boost';
import {graphql} from 'react-apollo'

const GET_TEAMS_QUERY = gql`
    {
        teams{
            name
            id
        }
    }
`

class AddDriver extends Component {
    render() {
        return (
          <form id="add-driver">
            <div className="field">
              <label>First Name:</label>
              <input type="text" />
            </div>
            <div className="field">
              <label>Last Name:</label>
              <input type="text" />
            </div>
            <div className="field">
                <label>Nationality:</label>
                <input type="text" />
            </div>
            <div className="field">
                <label>Team</label>
                <select>
                    <option>Select Team</option>
                </select>
            </div>
            <button>Add</button>
          </form>
        );
    }
}

export default graphql(GET_TEAMS_QUERY)(AddDriver);
